import './App.css';
import { useState, useEffect } from 'react';
import { CSAPIInstance } from './classes/CounterStrikeApi';


function App() {

  const [text, setText] =  useState<string>("");
  const [img, setImg] = useState<string>("");


  useEffect(() => {

    let img_:string = "";
    let text_:string = "N/A";

    CSAPIInstance.fetchRandomProfiles(1).then((val) => {
      if(val != null){
        text_ = val.username;
        img_ = val.fullAvatarImg;
        setText(text_);
        setImg(img_);
      }
    });

  }, [])

  return (
    <div className="App">
      hello
      {text}
      <img src={img} />
    </div>
  );
}

export default App;
